import React from 'react';

const SurveyList = ({ surveys, onBack, formatFieldName }) => {
  return (
    <div>
      <button className="btn btn-secondary mb-3" onClick={onBack}>
        ‚Üê Volver a proyectos
      </button>
      <h2>Encuestas del proyecto</h2>
      {surveys.map((survey, index) => (
        <div key={index} className="card mb-3">
          <div className="card-body">
            <h3 className="card-title">Encuesta #{index + 1}</h3>
            {Object.entries(survey).map(([key, value]) => {
              // Excluir campos innecesarios
              if (
                key.startsWith('_') &&
                !['_submission_time', '_geolocation'].includes(key)
              ) {
                return null;
              }

              return (
                <div key={key} className="mb-2">
                  <strong>{formatFieldName(key)}:</strong> {String(value)}
                </div>
              );
            })}
          </div>
        </div>
      ))}
    </div>
  );
};

export default SurveyList;
